import CharcaterCards from "./characterCards";



export default function Home(){
    const [character, setCharacters] = useState({})
    const handleInputChange = (e) => {
        e.preventDefault();
        setCharacters(e.target.value)
    }
    return (
        <div>

          <button >
            Entrar
            value={character}
            onChange={handleInputChange}
            </button>
        </div>
    )
}
